import "./assets/sass/components/app/app.scss";
import Mainsection from "./components/main-section";
import Nav from "./components/nav";

function App() {
  return (
    <div className="App">
      <div className="app-container">
        <Nav />
        <Mainsection />
      </div>
    </div>
  );
}

export default App;
